import React from "react";

export default function Form() {
    return (
        <div>
            <h2>¡Bienvenido!</h2>
            <form>
                <label>Email</label> <br />
                <input name='email' placeholder="Email..." />
                <br />
                <label>Password</label> <br />
                <input name='password' type='password' />
                <br />
                <button>Submit</button>
            </form>
        </div>
    );
}
